import React from 'react'
import { BrowserRouter as Router, Routes, 
  Route, Redirect,} from "react-router-dom";
import Home from "../App"
import Upload from "../uploading/client/src/App" 
//navs the name of each different list item
//gonna be a home page and a help page

//Need to add props for the nav tittles
function Navbar({navs}) {
  return (


    <nav className="navbar">
 
        <div class="logo">SoundScape Mapper</div>
        <ul class="nav-links">
        <input type="checkbox" id="checkbox_toggle" />
        <label for="checkbox_toggle" class="hamburger">&#9776;</label>
        
        
        </ul>
        <Router>
        <Route>
          <Route path="../App.js" element={Home} />
          <Route path="../uploading/client/src/App.js" element={Upload} />
        </Route>
      </Router>
        </nav>
        )
}

export default Navbar
